import React, { Component, lazy, Suspense } from 'react';
// import React, {Component} from "react";
import logo from './logo.svg';

//Data
import PhotoData from "./testData";

//Lasy
const LazyPhotoComponet = lazy(() => import("./lazyComponet"));
const LasyAlbumComponet = lazy(() => import("./lazyComponet"));

// import LazyPhotoComponet from "./lazyComponet";



class lazyContainer extends Component {
    constructor(){
        super();
        this.state = {
            albumDB: {},
            photoDB: {},
            isConected: false,
            albumLevel: false,
            albumIndex: 0,
            photoIndx: -1,
            isMore: true
        };
    };

    componentDidMount(){
        // fetch('https://jsonplaceholder.typicode.com/photos/1')
        fetch('https://jsonplaceholder.typicode.com/photos?_page=1&_limt=10')
        .then(response => response.json())
        .then(data => {
            this.setState({
            photoDB: data,
            isConected: true,
            albumLevel: true
            });
            console.log(data);
        });
    };

    handleClick = (event) => {/*No bind needed */
        console.log("e " + event.target.id);
        let id = event.target.id;
        // if(id === "photo_"){
        //     this.setState({
        //         photoIndx: -1
        //     })
        // } else {
        //     this.setState({
        //         photoIndx: id
        //     })
        // }

        if(this.state.albumLevel){//Get the clicked album id
            this.setState({
                albumIndex: id,
                albumLevel: false,
                photoIndx: -1
            })
        }
        else {//Inside selected Album
            if(id === "backToAlbum"){//If back to Album is clicked
                this.setState({
                    albumIndex: 0,
                    albumLevel: true,
                    photoIndx: -1
                })
            }
            else {//If Photo is clicked
                if(this.state.albumIndex) {//If Album id is not 0
                    if(id === "photo_"){//If selected Photo is in full view then close it
                        this.setState({
                            photoIndx: -1
                        })
                    } else {//Display the selected photo in full view
                        this.setState({
                            photoIndx: id
                        })
                    }
                }
            }

        }




        // this.setState({
        //     albumIndex: event.target.id
        //     //prevState => {
        //     //return {
        //     //    albumIndex: !prevState.albumIndex
        //     //}
        // })
        // const {name, value, type, checked} = event.target;
        // type === "checkbox" ? this.setState({ [name] : checked }) : this.setState({ [name] : value })
        // if(type === "checkbox") this.setState({ [name] : checked })
        // else if(type === "textarea") this.setState({ [value] : value })
        //     else this.setState({ [name] : value })

    }

    render() {
        const photoData = this.state.photoDB;
        console.log("pDATA " + photoData[0])
        var myJSON = JSON.stringify(photoData[0]);
        console.log("pDATA " + myJSON)
        console.log(" ")
        console.log("PDATA " + PhotoData)
        myJSON = JSON.stringify(PhotoData);
        console.log("pDATA " + myJSON)
        var count = Object.keys(PhotoData).length;
        console.log(count);

        let x = 0, num = 0;
        
        let db={};

        for(let i=0; i<count; i++){
            console.log("== " + PhotoData[i].albumId + " " + PhotoData[i].id)
            if(PhotoData[i].albumId !== num){
                num = PhotoData[i].albumId;
                db[x] = {"num": num, "startID": PhotoData[i].id, "thumbnail": PhotoData[i].thumbnailUrl};
                console.log("+= " + num + " - " + x)
                x++;
                console.log(db);
            }
        }

        const clickedUrl = this.state.photoIndx === -1? null : PhotoData[this.state.photoIndx - 1].url;
        // const clickedTitle = this.state.photoIndx === -1? null : PhotoData[this.state.photoIndx - 1].title;

        const imageStyle={
            backgroundColor: "#fff",
            backgroundImage: 'url('+ clickedUrl +')'
        }
        // //Album componets
        // const albumComponets = PhotoData.map(
        //     item => 
        //     <LasyAlbumComponet key={item.id} data={item}
        //     albumIndex={this.state.albumIndex}
        //     handleClick={this.handleClick}
        //     />
        //     )

        //Photo Componets
        const photoComponets = PhotoData.map(
            item => 
            <LazyPhotoComponet key={item.id} data={item}            
            albumIndex={this.state.albumIndex}
            photoIndx={this.state.photoIndx}
            handleClick={this.handleClick}
            />
            )
      return (
        <div>
            <Suspense fallback={<div>Loading ....<img src={logo} className="App-logo" alt="logo" /></div>}>
            <div className={this.state.albumIndex ? "back" : "hide"} id="backToAlbum" onClick={this.handleClick} >BackToAlbum</div>
            {/* {albumComponets} */}
            {photoComponets}

            <div className={this.state.photoIndx === -1 ? "hide" : null} onClick={this.handleClick} id={"photo_"}
            style={imageStyle}
            >
            </div>

            </Suspense>
            {/* {this.state.photoDB.id} */}
          {/* <Suspense fallback={<div>Loading ....<img src={logo} className="App-logo" alt="logo" /></div>}>
            <LazyPhotoComponet
                data={this.state}
                handleChange={this.handleChange}
            />
          </Suspense> */}
        {/* {document.getElementById('photo_'+this.state.photoLevel).className += "hide"} */}
        </div>
      );
    }
  }
  
  export default lazyContainer;
